package com.example.tprecyleview;

import static android.content.ContentValues.TAG;

import android.os.Bundle;
import android.util.Log;
import android.view.Menu;
import android.view.MenuItem;
import android.widget.SearchView;
import android.widget.Toolbar;

import androidx.activity.EdgeToEdge;
import androidx.appcompat.app.AppCompatActivity;
import androidx.core.app.ShareCompat;
import androidx.core.graphics.Insets;
import androidx.core.view.MenuItemCompat;
import androidx.core.view.ViewCompat;
import androidx.core.view.WindowInsetsCompat;
import androidx.recyclerview.widget.LinearLayoutManager;
import androidx.recyclerview.widget.RecyclerView;

import com.example.tprecyleview.adapter.StarAdapter;
import com.example.tprecyleview.beans.Star;
import com.example.tprecyleview.service.StarService;

import java.util.ArrayList;
import java.util.List;

public class ListActivity extends AppCompatActivity {
    private List<Star> stars;
    private RecyclerView recyclerView;
    private StarAdapter starAdapter = null;
    private StarService service;
    @Override
    protected void onCreate(Bundle savedInstanceState) {
        super.onCreate(savedInstanceState);
        setContentView(R.layout.activity_list);

        // Initialiser le service
        service = StarService.getInstance();

        // Ajouter des données de test
        init();

        // Configurer le RecyclerView
        recyclerView = findViewById(R.id.recycle_view); // Vérifiez l'ID correct !

        // Vérification pour éviter NullPointerException
        if (recyclerView != null) {
            stars = service.findAll();
            starAdapter = new StarAdapter(this, stars);
            recyclerView.setAdapter(starAdapter);
            recyclerView.setLayoutManager(new LinearLayoutManager(this));
        } else {
            Log.e("ListActivity", "RecyclerView not found!");
        }
    }
    @Override
    public boolean onCreateOptionsMenu(Menu menu) {
        Log.d("ListActivity", "onCreateOptionsMenu called");
        getMenuInflater().inflate(R.menu.menu, menu);
        MenuItem menuItem = menu.findItem(R.id.app_bar_search);
        setTitle("Stars");
        SearchView searchView = (SearchView) MenuItemCompat.getActionView(menuItem);
        searchView.setOnQueryTextListener(new SearchView.OnQueryTextListener() {
            @Override
            public boolean onQueryTextSubmit(String query) {
                return true;
            }

            @Override
            public boolean onQueryTextChange(String newText) {
                if (starAdapter != null) {
                    starAdapter.getFilter().filter(newText);
                }
                return true;
            }
        });
        return true;
    }

    @Override
    public boolean onOptionsItemSelected(MenuItem item) {
        if(item.getItemId() == R.id.share){
            String txt = "Stars";
            String mimeType = "text/plain";
            ShareCompat.IntentBuilder
                    .from(this)
                    .setType(mimeType)
                    .setChooserTitle("Stars")
                    .setText(txt)
                    .startChooser();
        }
        return super.onOptionsItemSelected(item);
    }
    public void init(){
        service.create(new Star("Leonardo DiCaprio", "https://d1jyxxz9imt9yb.cloudfront.net/person/1605/detail_image/mobile/LDC-High-Res-Headshot.jpg", 4.5f));
        service.create(new Star("Scarlett Johansson", "data:image/jpeg;base64,", 4.7f));
        service.create(new Star("Denzel Washington", "data:image/jpeg;base64,", 4.8f));
        service.create(new Star("Emma Stone", "data:image/jpeg;base64,", 4.3f));
        service.create(new Star("Tom Hardy", "data:image/jpeg;base64,", 4.6f));
        service.create(new Star("Zendaya", "data:image/jpeg;base64,", 4.2f));

    }
}